const SwiftIconStyled = styled.i`
  svg {
    display: block;
    ${(props) => (props.color && props.color == "primary" ? `fill:${"#1b6191"};` : props.color ? `fill:${props.color};` : ``)}
  }
`

const SwiftIcon = (props) => {
  const { i, className, color } = props
  if (!i) return <></>

  if (Object.keys(icons).includes(i))
    return (
      <SwiftIconStyled className={className} color={color}>
        {icons[i]}
      </SwiftIconStyled>
    )

  return <></>
}
SwiftIcon.defaultProps = {
  className: null,
  color: null,
}

export default SwiftIcon
